import React from 'react';
import './testimonials.css'
//import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
//import { faInstagram, faFacebook, faTwitter, faYoutube } from '@fortawesome/free-brands-svg-icons'
//import { faMapMarkerAlt, faMobileAlt, faEnvelope } from '@fortawesome/free-solid-svg-icons'
//import img1 from '../../assets/images/appstore.svg';
//import img2 from '../../assets/images/chplay.svg';

export default function Testimonials1 () {

    return (
        <div className='testimonials-box'>
            <div className='testimonials-avatar rounded-circle mt-5'></div>
            <div className='testimonials-name mt-3'>Huynh Thi A</div>
            <div className='testimonials-content mt-3 pt-3'>"On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, so blinded by desire‚Äù
            </div>
        </div>
    )
}
